import { Box, SxProps, Theme } from "@mui/material";

export const Piano = () => {
    return (
        <Box className="Piano" sx={sx}>
            ピアノ
        </Box>
    );
};

const sx: SxProps<Theme> = {
    "&.Piano": {
        width: "100%",
    },
};
